import React from 'react';
// import Image from 'next/image';

const Catalog = () => {
    const animals = [
        {
            id: 1,
            name: "Buddy",
            age: 3,
            breed: "Golden Retriever",
            healthCondition: "Excellent",
            // imageUrl: "/placeholder.svg?height=200&width=200"
        },
        {
            id: 2,
            name: "Luna",
            age: 2,
            breed: "Siamese Cat",
            healthCondition: "Good",
            // imageUrl: "/placeholder.svg?height=200&width=200"
        },
        {
            id: 3,
            name: "Max",
            age: 5,
            breed: "German Shepherd",
            healthCondition: "Fair",
            // imageUrl: "/placeholder.svg?height=200&width=200"
        },
        {
            id: 4,
            name: "Bella",
            age: 1,
            breed: "Labrador Retriever",
            healthCondition: "Excellent",
            // imageUrl: "/placeholder.svg?height=200&width=200"
        },
        {
            id: 5,
            name: "Charlie",
            age: 4,
            breed: "Persian Cat",
            healthCondition: "Good",
            // imageUrl: "/placeholder.svg?height=200&width=200"
        },
        {
            id: 6,
            name: "Lucy",
            age: 2,
            breed: "Beagle",
            healthCondition: "Excellent",
            // imageUrl: "/placeholder.svg?height=200&width=200"
        }
    ];

    return (
        <div className="container mx-auto px-4 py-8">
            <h1 className="text-3xl font-bold mb-6 text-center">Available Animals</h1>
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
                {animals.map((animal) => (
                    <div key={animal.id} className="bg-white rounded-lg shadow-md overflow-hidden">
                        {/*<Image*/}
                        {/*    src={animal.imageUrl}*/}
                        {/*    alt={animal.name}*/}
                        {/*    width={200}*/}
                        {/*    height={200}*/}
                        {/*    className="w-full h-48 object-cover"*/}
                        {/*/>*/}
                        <div className="p-4">
                            <h2 className="text-xl font-semibold mb-2">{animal.name}</h2>
                            <p className="text-gray-600 mb-1">Age: {animal.age} years</p>
                            <p className="text-gray-600 mb-1">Breed: {animal.breed}</p>
                            <p className="text-gray-600">Health: {animal.healthCondition}</p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Catalog;
